import React, { useState } from "react";
import { useTheme } from "@material-ui/styles";
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea } from '@mui/material';
import IconButton from '@mui/material/IconButton';
import ThumbDownIcon from '@mui/icons-material/ThumbDown';
import ThumbUpIcon from '@mui/icons-material/ThumbUp';
import MessageIcon from '@mui/icons-material/Message';
// styles

// components
import { Typography } from "../../../../components/Wrappers/Wrappers";

export default function Topthree(props) {
  var { user, title, post_time, theme, post_content, picture, hashtag, like, dislike, comment_count} = props;
  console.log(post_time.toTimeString())
  return (
    <Card md={4} sm={12} xs={12} style={{backGroundColor:'gray'}} elevation={5}>
    <CardActionArea style={{height:'350px',display:'flex',alignItems:'flex-start'}}>
      <CardContent style={{width:'100%'}}>
        <Typography gutterBottom component="div" style={{color:'#A9A9A9'}}>
          {user}
        </Typography>
        <Typography gutterBottom variant="h5" component="div">
        {hashtag} {title}
        </Typography>
        <CardMedia
          component="img"
          height="140"
          image={picture[0]}
          alt="green iguana"
        />
        <Typography variant="body2" color="text.secondary">
          {post_content.slice(0,50)}
          {post_content.length<50?(""):("...")}
        </Typography>
      </CardContent>
    </CardActionArea>
    <Typography variant="body2" color="text.secondary" style={{textAlign:'right',marginRight:'10px'}}>
            {post_time.getFullYear()} {post_time.getMonth()} {post_time.getDay()}
    </Typography>
    <Typography variant="body2" color="text.secondary" style={{textAlign:'right'}}>
      {like}
      <IconButton>
        <ThumbUpIcon/>
      </IconButton>
      {dislike}
      <IconButton>
        <ThumbDownIcon/>
      </IconButton>
      {comment_count}
      <IconButton>
        <MessageIcon/>
      </IconButton>
    </Typography>
  </Card>
  );
}
